import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open a product modal to ensure there is a modal to close
    // Use the first product card available
    await page.waitForSelector('.product-card', { timeout: 5000 });
    const productCard = await page.$('.product-card');
    await productCard.click();

    // Wait for the modal to appear
    await page.waitForSelector('#productModal', { timeout: 5000 });
    // Wait for modal to be visible (display: block)
    await page.waitForFunction(() => {
      const el = document.getElementById('productModal');
      return el && window.getComputedStyle(el).display !== 'none';
    }, { timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    // Press Escape to close the modal
    await page.keyboard.press('Escape');

    // Wait for the modal to be hidden (display: none)
    await page.waitForFunction(() => {
      const el = document.getElementById('productModal');
      return el && window.getComputedStyle(el).display === 'none';
    }, { timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_closed.png'));

    // Extract data to verify the modal is closed
    const modalDisplay = await page.evaluate(() => {
      const el = document.getElementById('productModal');
      return el ? window.getComputedStyle(el).display : null;
    });

    return {
      success: true,
      action: "Closed the product modal using the Escape key",
      extractedData: {
        productModalDisplay: modalDisplay
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
